<?xml version="1.0" encoding="utf-8"?>
<!DOCTYPE html PUBLIC "-//W3C//DTD HTML 4.01 Transitional//EN"
   "http://www.w3.org/TR/html4/loose.dtd">
<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">
<head>
  <title>Winamp Online Services Error Page</title>
  <meta http-equiv="content-type" content="text/html;charset=utf-8" />
  <meta http-equiv="Content-Style-Type" content="text/css" />
  <link rel="stylesheet" href="./winampError.css" type="text/css" media="all"/>
</head>
<body>
    <!-- Container -->
    <div id="errorContainer">
	  <!-- Icon -->
      <div id="errorIcon">
      </div>
	  <!-- Error Body -->
      <div id="errorBody">
        <!-- Error Title -->
        <div id="errorTitle">
        <h1 id="errorTitleText">Action Canceled</h1></div>
	    <!-- Error Code -->
        <div id="errorCode">
        <noscript>Action Canceled</noscript>
        </div>
        <!-- Error Description -->
        <div id="errorDesc">
        <p id="errorDescText">Navigation to the page has been canceled by the user.</p>
        </div>
      </div>
    </div>
</body>
</html>
